class App extends Component {
  render() {
    return (
      <div className="App">
        <Particles
          params={{
            particles: {
              line_linked: {
                shadow: {
                  enable: true,
                  color: "#3CA9D1",
                  blur: 5
                }
              }
            }
          }}
          style={{
            width: '100%',
            backgroundImage: `url(${logo})`
          }}
        />
        <Navigation />
        <Logo />
        <ImageLinkForm />
        {/* <FaceRecognition />*/}
      </div>
    );
  }
  }

export default App;
